import React from 'react';
import './Navbar.css';

function Navbar() {
  return (
    <>
    <div className="navbar-container">
        
    </div>
    <div className="navbar-title">
        <p>Home</p>
        <p>About</p>
        <p>Portfolio</p>
        <p>Contact</p>
    </div>
    </>
  )
}

export default Navbar
